import React, { useEffect, useState } from "react";
import { CategoryModel, bookModel } from "../../Interfaces";
import { BookCard } from ".";
import { useGetBooksQuery } from "../../Apis/bookApi";

function BookList() {
  const [books, setBooks] = useState<bookModel[]>([]);
  const [categories, setCategories] = useState<CategoryModel[]>([]);

  const {data, isLoading} = useGetBooksQuery

  useEffect(() => {
    fetch("https://blibraryapi.azurewebsites.net/api/Book")
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setBooks(data.result);
      });
  }, []);

  return (
    <div className="container row" style={{paddingBottom: "100px"}}>
      {books.length > 0 &&
        books.map((book, index) => <BookCard book={book} key={index} />)}
    </div>
  );
}

export default BookList;
